const JokesData = [
    {
        id: 1,
        punchLine: "It is hard to explain puns to kleptmanics because they always take things literally.",
    },
    {
        id: 2,
        question: "What is the best thing about Switzerland?",
        punchLine: "I do not know, but the flag is a big plus!",
    },
    {
        id: 3,
        question: "Did you hear about the mathematicians who is afraid of negative numbers?",
        punchLine: "He will stop at nothing to avoid them!",
    },
    {
        id: 4,
        question: "Did you hear about the new restaurant called Karma?",
        punchLine: "There is no menu: You get what you deserve.",
    },
    {
        id: 5,
        question: "Did you hear about the actor who fell through the floorboards?",
        punchLine: "He was just going through a stage.",
    },
    {
        id: 6,
        question: "Did you hear about the claustrophobic astronaut?",
        punchLine: "He just needed a little space.",
    }
]

export default JokesData;
